var flowfield;

function setup(){
    createCanvas(700, 700);

    img = loadImage('california.PNG');
    //creating rows & columns for the flow field according to scale
    colm = floor(width/scl);
    rows = floor(height/scl);
    flowfield = new Array(colm + rows);

      
    strokeWeight(3);

    //draw vectors
    var yoff = 0; //y offset
    for(var y = 0; y < rows; y++){
        var xoff = 0; //x offset
        for(var x = 0; x < colm; x++){
            var index = x + y * colm;
            //vectors stored here in this array!
            var angle = PI/2;
            if(y > ((6/5)*x+10)){
                angle = 7*PI /4; 
            } else if (y < ((9/5)*x - 25)) {
                angle = 3*PI/4;
            } else {
                angle = 5 * PI / 4;
            }
            var v = p5.Vector.fromAngle(angle);
            
            if(y > ((6/5)*x+10)){
                //bottom left area
                v.setMag(0.5);
            } else if (y < ((9/5)*x - 25)) {
                //top right area
                v.setMag(3.0);
            } else {
                //middle
                v.setMag(0.1);
            }
            flowfield[index] = v;
            xoff += inc;
            stroke(0);
            push();
            translate(x*scl, y*scl);
            rotate(v.heading());
            line(0,0,scl,0);
            pop();
        }
        yoff += inc;
    }
 
    //points
    for(var i = 0; i < coordinates.length; i++){
         var longY = map(coordinates[i][0], longMin, longMax, 0, height);
         var latX = map(coordinates[i][1], latMin, latMax, 0, width);
         fill(250, 0, 0);
         noStroke();
         circle(longY, height-latX, 1);
         //flock.push(new Boid(longY, height-latX));
         var whaleX = longY;
         var whaleY = height-latX;
         var nearestFieldX = floor(whaleX/rows);
         var nearestFieldY = floor(whaleY/colm);
         var index = nearestFieldX + nearestFieldY * colm;
         var newVector = createVector(whaleX/scl - nearestFieldX, whaleY/scl - nearestFieldY);
         newVector.setMag(0.00001);
         //var angle = flowfield[index].angleBetween(newVector);
         //var v = p5.Vector.fromAngle(angle);
         var v = p5.Vector.add(newVector, flowfield[index]);
         flowfield[index] = v;
     }

   
   //for(var i = 0; i < flowfield.length; i++){
   //    console.log(flowfield[i]);
   //}
   //coordinates.length
   
    //creates multiple boids
    for(let i = 0; i < 150; i++){ 
        flock.push(new Boid(-1,-1));
    }
}

function draw(){
   background(150);
   image(img,0,0);
   

    for(let boid of flock){
        boid.follow(flowfield); 
        boid.edges();
        boid.flock(flock);
        boid.update();
        boid.show();
    }
}